import android.content.ContentValues;
import android.content.Context;
import android.database.sqlite.SQLiteDatabase;
import android.database.sqlite.SQLiteOpenHelper;

/**
 * Created by Rizki Oktavia Ningru on 10/10/2017.
 */

public class userDBHandler extends SQLiteOpenHelper {

    private static final int DATABASE_VERSION = 1;
    private static final String DATABASE_NAME = "user.db";
    private static final String TABLE_USER= "users";
    private static final String COLUMN_ID= "id";
    private static final String COLUMN_USERNAME="username";
    private static final String COLUMN_PASSWORD ="password";

    public userDBHandler(Context context) {
        super(context,DATABASE_NAME,null,DATABASE_VERSION);
    }

    @Override
    public void onCreate(SQLiteDatabase db) {
        String query = "CREATE TABLE"+TABLE_USER+"("+COLUMN_ID+"INTEGER PRIMARY KEY,"+COLUMN_USERNAME+"TEXT,"+COLUMN_PASSWORD+"TEXT"+")";
        db.execSQL(query);
    }

    @Override
    public void onUpgrade(SQLiteDatabase db, int oldVersion, int newVersion) {
        db.execSQL("DROP TABLE IF EXISTS" + TABLE_USER);
        onCreate(db);
    }

    public void addUser(user users){
        SQLiteDatabase db = getWritableDatabase();
        ContentValues values = new ContentValues();
        values.put(COLUMN_USERNAME,users.getUsername_user());
        values.put(COLUMN_PASSWORD, users.getPass_user());
        db.insert(TABLE_USER,null,values);
        db.close();
    }

