```package id.org.oktakoroningrum.login;

import android.content.Intent;
import android.os.Bundle;
import android.support.v7.app.AppCompatActivity;
import android.view.View;
import android.widget.Button;
import android.widget.EditText;

import id.org.oktakoroningrum.login.database.user;
import id.org.oktakoroningrum.login.database.userDBHandler;

//ini kelas Login
public class LoginActivity extends AppCompatActivity {
    //deklarasi variabel untuk tiap komponen login
    EditText etUsername;
    EditText etPass;
    Button Login;
    userDBHandler userdbhandler;


    @Override
    protected void onCreate(Bundle savedInstanceState) {
        super.onCreate(savedInstanceState);
        setContentView(R.layout.activity_login);
        //deklarasi bagian komponen berdasarkan id
        Login = (Button) findViewById(R.id.button);
        etUsername = (EditText) findViewById(R.id.et_nama);
        etPass = (EditText) findViewById(R.id.et_pass);

        Login.setOnClickListener(new View.OnClickListener() {
            @Override
            public void onClick(View view) {
                masuk();
            }
        });
    }

    public void masuk() {
        String name = etUsername.getText().toString();
        String pass = etPass.getText().toString();

//        int id = checkUser (new user(name, pass));
        userdbhandler = new userDBHandler(LoginActivity.this);
        userdbhandler.addUser(new user (name, pass));
        Intent intent = new Intent(this, TestActivity.class);
        startActivity(intent);
    }

